//登陆页的基本操作
import LoginMod from './../login/Signin'
//登陆的首页
import PrivateZone from './privateZone'
//用户的信息维护
import UserInfo from './UserInfo'

import OwnInfo from './ownInfo'

export default [
  { path: "/login", name: "登陆页的基本操作", component: LoginMod},
  { path: "/", name: "登陆的首页", component: PrivateZone},
  { path: "/usermanage", name: "用户管理", component: UserInfo},
  { path: "/owninfo", name: "用户的个人的信息", component: OwnInfo},
]
